const [items, setItems] = useState([]);
useEffect(() => {
    fetch('https://backendapi.turing.com/products?page=1&limit=20')
    .then(res => res.json())
    .then(data => setItems(data.rows))
}, [] )

const initState = {
    items:items
}

const rootReducer = (state = initState, action) => {
    return state;
}

export default rootReducer
